	ToggleFuseDrive(context.Context, *ToggleFuseRequest) (*FuseDriveResponse, error)
	// Get status of FUSE drive. If mounted or unmounted
	GetFuseDriveStatus(context.Context, *empty.Empty) (*FuseDriveResponse, error)
